import { useHistory } from "react-router-dom";
import pb from "./ProfileButtons.module.css";

export default function ProfileButtons({props}) {
  const redirect = useHistory();

  const email = props;
  console.log(email)

  const onClick = (event) => {
    event.preventDefault();

    redirect.push("/addreview", { email: email });
  };

  const signOut = (event) => {
    event.preventDefault();
    redirect.push("/signin");
  };

  return (
    <div>
      <h1>{email}'s book reviews!</h1>
      <button className={pb.add} onClick={onClick} key="1">Add book review</button>
      <button className={pb.signout} onClick={signOut} key="2">Sign out</button>
    </div>
  );
}
